import React, { Component } from "react";
import Component1 from "./component1";

class Counters extends Component {
  state = {
    counters: [
      { id: 1, value: 0 },
      { id: 2, value: 0 },
      { id: 3, value: 0 },
      { id: 4, value: 0 },
      { id: 5, value: 0 },
    ],
  };
  render() {
    return (
      <div>
        <ul>
          {this.state.counters.map((Counter) => (
            <Component1 key={Counter.id} value={Counter.value} />
          ))}
        </ul>
      </div>
    );
  }
}

export default Counters;
